import formatDate from "../../util/formatDate";
import handleBookingStatusColor from "../../util/bookingStatusColor";

const tableData = (typeData, data) => {
  switch (typeData) {
    case "client":
      return          <a href={`/clients/${data.client.clientId}`}>
                 {item.client.firstName} {item.client.lastName}
               </a>
    case "bookingTime":
      return formatDate(data.bookingDate, "TIME");
    case "bookingDate":
      return formatDate(data[typeData]);
    case "status":
      return (
        <span
          className={`badge badge-${handleBookingStatusColor(
            data.bookingStatus
          )}`}
        >
          {data.bookingStatus}
        </span>
      );
    case "id":
      return data[typeData];
    case "firstName":
      return data[typeData];
    case "lastName":
      return data[typeData];
    case "clientId":
      return data[typeData];
    case "email":
      return data[typeData];
    case "phoneNo":
      return "+" + data[typeData];
    case "createdDate":
      return formatDate(data[typeData], "UTC");
    case "updatedDate":
      return formatDate(data[typeData], "UTC");
    case "action":
      return (
        <a href={`/clients/${data.clientId}`}>
          {" "}
          <i className="fas fa-ellipsis-h" />
        </a>
      );
    default:
      return "Error showing data on table";
  }
};

export default tableData;
